import React from "react";
import PreparedBySelector from "./PreparedBySelector";
import TextInput from "./TextInput";
import Dropdown from "./Dropdown";
import DateSelector from "./DateSelector";
import RevisionSelector from "./RevisionSelector";
import DateFormatSelector from "./DateFormatSelector";
import GradientSelector from "./GradientSelector";

function StampForm(props) {
  const {
    jobName,
    setJobName,
    jobCode,
    setJobCode,
    boxFolder,
    setBoxFolder,
    preparedFor,
    setPreparedFor,
    preparedBy,
    setPreparedBy,
    date,
    setDate,
    isRevision,
    setIsRevision,
    jobPhase,
    setJobPhase,
    gradientStyle,
    setGradientStyle,
    dateFormat,
    setDateFormat,
    speccedByOthers,
    setSpeccedByOthers,
    revisionNumber,
    setRevisionNumber,
  } = props;

  const jobPhaseOptions = [
    { label: "Planning", value: "planning" },
    { label: "Execution", value: "execution" },
  ];

  return (
    <div>
      <p>Stamp Form</p>
      <PreparedBySelector value={preparedBy} setValue={setPreparedBy} />
      <TextInput
        label="Job Name"
        value={jobName}
        onChange={(e) => setJobName(e.target.value)}
      />
      <TextInput
        label="Job Code"
        value={jobCode}
        onChange={(e) => setJobCode(e.target.value)}
      />
      <TextInput
        label="Prepared For"
        value={preparedFor}
        onChange={(e) => setPreparedFor(e.target.value)}
      />
      <TextInput
        label="Box Folder Link"
        value={boxFolder}
        onChange={(e) => setBoxFolder(e.target.value)}
      />
      <DateFormatSelector
        dateFormat={dateFormat}
        setDateFormat={setDateFormat}
      />
      <GradientSelector
        gradient={gradientStyle}
        setGradient={setGradientStyle}
      />
      <RevisionSelector isRevision={isRevision} setIsRevision={setIsRevision} />
      <DateSelector selectedDate={date} setSelectedDate={setDate} />
      <Dropdown
        label="Job Phase"
        value={jobPhase}
        onChange={(e) => setJobPhase(e.target.value)}
        options={jobPhaseOptions}
      />
    </div>
  );
}

export default StampForm;
